import React from 'react';
import Moment from 'react';
import Logs from './Logs';
import PropTypes from 'prop-types';

const LogItem = ({ log }) => {
	console.log(log);
	return <></>;
};

LogItem.propTypes = {
	log: PropTypes.object.isRequired,
};

export default LogItem;
